import React from "react";
import Card from "./card";


function Stuff() {
  return (
    <div style={cardStyling}>
      <Card
        url="https://giphy.com/embed/62tGXpMH900jbKnyUK"
        alignment="left"
        key={1}
        name="My Projects"
      />
      <Card
        url="https://giphy.com/embed/kFd76qcrqQK6qefgXK"
        alignment="right"
        key={2}
        name="My Blogs"
      />
    </div>
  );
}

export default Stuff;
